OCA.Music = OCA.Music || {};

/** @namespace */
OCA.musicnc.DummyAudio = {

	/**
	 * Get 6 seconds of low-quality MP3 white noise in base64 format. Audio shorter than 5 s might not be 
	 * enough to activate the mediaSession integration on all browsers, as wouldn't a completely silent audio.
	 */
	getData: function() {
		return 'data:audio/mpeg;base64,';
	}
};